import React, {useState} from 'react';
import {URL_IMAGE_PREFIX} from "../../constants";
import {Carousel} from 'react-bootstrap';
import movie1 from '../../img/movie1.jpg';
import movie2 from '../../img/movie2.jpeg';
import movie3 from '../../img/movie3.jpg';
import './home-tab.css';

const home = (props) => {

    return (
        <div className="carousal_container">
            <Carousel className='my_carousel'>
                <Carousel.Item>
                    <img
                        className="my_carousel_image"
                        src={movie1}
                        alt="First slide"
                    />
                </Carousel.Item>
                <Carousel.Item>
                    <img
                        className="d-block w-100"
                        src={movie2}
                        alt="Second slide"
                    />
                </Carousel.Item>
                <Carousel.Item>
                    <img
                        className="d-block w-100"
                        src={movie3}
                        alt="Third slide"
                    />
                </Carousel.Item>
            </Carousel>
        </div>
    );
}

export default home;
